import React, {useState} from "react";
import style from "./KonstructorCart.module.css"
import {Link, useParams} from "react-router-dom";

export const KonstructorCart=()=>{

    const {id}=useParams();

    let arr=[
        {
            id:0,
            src:"https://eco-wood-art.by/wp-content/uploads/2022/08/22222-300x300.jpg",
            zagolovok:"Дикий кот",
            price:"89.00 BYN"
        },
        {
            id:1,
            src:"https://eco-wood-art.by/wp-content/uploads/2022/08/1111-300x300.jpg",
            zagolovok:"Черный кот",
            price:"89.00 BYN"
        },
        {
            id:2,
            src:"https://eco-wood-art.by/wp-content/uploads/2022/03/j-300x169.jpg",
            zagolovok:"ВЕТРЯНАЯ МЕЛЬНИЦА",
            price:"89.00 BYN"
        },
        {
            id:3,
            src:"https://eco-wood-art.by/wp-content/uploads/2022/02/1-300x169.jpg",
            zagolovok:"Самолет",
            price:"89.00 BYN"
        },
        {
            id:4,
            src:"https://eco-wood-art.by/wp-content/uploads/2022/01/j1-300x169.jpg",
            zagolovok:"ГЕЙМСЕТ домино Мексиканский поезд",
            price:"139.00 BYN"
        },
        {
            id:5,
            src:"https://eco-wood-art.by/wp-content/uploads/2021/10/1-1-300x169.jpg",
            zagolovok:"Скайлорд",
            price:"119.00 BYN"
        },
        {
            id:6,
            src:"https://eco-wood-art.by/wp-content/uploads/2021/10/1-300x169.jpg",
            zagolovok:"Луноход",
            price:"119.00 BYN"
        },
        {
            id:7,
            src:"https://eco-wood-art.by/wp-content/uploads/2021/09/1-1-300x169.jpg",
            zagolovok:"Прицеп для БЕЛАРУС-82 и БЕЛАРУС-2022",
            price:"139.00 BYN"
        },
    ];



    return(
        <div className={style.ddd}>
                <div className={style.wrapper3}>
                    <div className={style.wrapper4}><img src={arr[id].img} alt=""/>
                        <h2>{arr[id].name}</h2>
                        <p>{arr[id].price}</p>
                    </div>
                </div>
        </div>
    )
}
